import React from 'react';
import './SolutionPage.css';

export default function CallAnsweringService() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">24/7 Call Answering Service</h1>
      <p className="solution-desc">Rosie provides round-the-clock call answering so you never miss a customer, no matter the time of day. Our AI ensures every call is handled with care and professionalism.</p>
      <div className="solution-section">
        <h2>Why Choose 24/7 Call Answering?</h2>
        <ul>
          <li>Never miss a business opportunity</li>
          <li>Instant responses for your customers</li>
          <li>Professional, friendly AI agents</li>
        </ul>
      </div>
    </div>
  );
}
